import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className="flex flex-wrap items-center justify-between w-screen bg-onxy-300">
                <div className="flex flex-row items-center justify-between px-2 py-6">
                    <a className="text-white font-bold text-xl">Created By<span className="text-blue-500 ml-2 font-medium">Josi</span></a>
                </div>
                <div className="flex flex-shrink mr-4">
                    <a className="bg-blue-600 px-2 py-4 rounded transition ease-in-out duration-500 hover:bg-blue-700">Fork on Github</a>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
